/** @jsxImportSource @emotion/react */

function Form({ action }) {
    const onClickSubmit = () => {
        action();
    }

    return (
        <div>
            <input type="text" placeholder="Name" />
            <input type="text" placeholder="Email" />
            <input type="text" placeholder="Message" />
            <button onClick={onClickSubmit}>Submit</button>
        </div>
    )
}

export default Form;
